import Foundation

func repeatedCharacter(_ s: String) -> Character {
    var characters = [Character]()
    
    for char in s {
        if characters.contains(char) {
            return char
        } else {
            characters.append(char)
        }
    }
    
    return " "
}
    


let startTime = Date()

